import {
  IonMenu,
  IonHeader,
  IonToolbar,
  IonTitle,
  IonContent,
  IonList,
  IonItem,
  IonIcon,
  IonLabel,
  IonRouterOutlet,
  IonButton,
} from '@ionic/react';
import React from 'react';
import { Redirect, Route } from 'react-router-dom';
import { home as homeIcon, settings as settingsIcon, calendar as calendarIcon } from 'ionicons/icons';
import HomePage from './pages/HomePage';
import EntryPage from './pages/EntryPage';
import SettingsPage from './pages/SettingsPage';
import { useAuth } from './auth';
import AddEntryPage from './pages/AddEntryPage';
import CalendarPage from './pages/CalendarPage';

const AppMenu: React.FC = () => {
  const { loggedIn } = useAuth();

  if (!loggedIn) {
    return <Redirect to="/login" />;
  }

  return (
    <>
      <IonMenu contentId="main" side="start">
        <IonHeader>
          <IonToolbar>
            <IonTitle>Menu</IonTitle>
          </IonToolbar>
        </IonHeader>
        <IonContent>
          <IonList>
            <IonItem routerLink="/my/entries" routerDirection="none">
              <IonIcon icon={homeIcon} slot="start" />
              <IonLabel>Home</IonLabel>
            </IonItem>
            <IonItem routerLink="/my/calendar" routerDirection="none">
              <IonIcon icon={calendarIcon} slot="start" />
              <IonLabel>Calendar View</IonLabel>
            </IonItem>
            <IonItem routerLink="/my/settings" routerDirection="none">
              <IonIcon icon={settingsIcon} slot="start" />
              <IonLabel>Settings</IonLabel>
            </IonItem>
          </IonList>
        </IonContent>
      </IonMenu>

      <IonRouterOutlet id="main">
        <Route exact path="/my/entries">
          <HomePage />
        </Route>
        <Route exact path="/my/entries/view/:id">
          <EntryPage />
        </Route>
        <Route exact path="/my/settings">
          <SettingsPage />
        </Route>
        <Route exact path="/my/entries/add">
          <AddEntryPage />
        </Route>
        <Route exact path="/my/calendar">
          <CalendarPage />
        </Route>
      </IonRouterOutlet>
    </>
  );
};

export default AppMenu;
